import { Link } from "react-router-dom";

const Blogs = ({ tale, title }) => {
    return (
        <div>
            <h2>{title}</h2>
            <div className="row gx-2">
                {tale.map(tale => (
                    <div className="Tale-preview col-6" key={tale.id}>
                        <Link to={`/tale/${tale.id}`}>
                            <h2>{tale.title}</h2>
                            <p>in {tale.city}</p>
                        </Link>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Blogs;
